import { Link } from "react-router-dom";
import ColorList from "./ColorList";
import { v4 as uuid } from "uuid";

const HomeColor = ()=>{
    return (
        <div className="App">
          <h1>Color Picker</h1>
          <ul>
            {ColorList.map((color)=>{
                return(<li key={uuid()}><Link>{color}</Link></li>);
                
            })}
          </ul>
        </div>
      );
}
export default HomeColor;
